let data = JSON.parse(jsonData)

function search_gene() {
  let input = document.getElementById('searchbar').value
  input = input.toLowerCase();
  let entry = document.querySelector('#table-holder');
  entry.innerHTML = ""

  if (input === "") {
    return;
  }

  const header_array = ["Gene Symbol", "Entrez ID", "Ensembl ID", "Core AutophagyNet", "AutophagyNet", "HADB", "HAMdb", "GO-0061919"]
  for (const element of header_array) {
        const header = document.createElement("th")
        header.innerHTML = element
        entry.appendChild(header)
    }

  for (i = 0; i < data.length; i++) {
    let obj = data[i];

    if (obj['Gene Symbol'].toLowerCase().includes(input)) {
      const row = document.createElement("tr")

    for (const element of header_array) {
        const entry_elem = document.createElement("td")
        entry_elem.innerHTML = `${obj[element]}`
        row.appendChild(entry_elem)
        }
      entry.appendChild(row)
    }
  }
}
